%spark

/** Stop any existing StreamingContext  */

if (true) {	
  StreamingContext.getActive.foreach { _.stop(stopSparkContext = false) }
} 

/** Get or create a streaming context */
val ssc = StreamingContext.getActiveOrCreate(creatingFunc)
if (newContextCreated) {
  println("New context created from currently defined creating function") 
} else {
  println("Existing context running or recovered from checkpoint, may not be running currently defined creating function")
}

Try(sqlContext.dropTempTable("mqtt_message_temp"))
Try(sqlContext.dropTempTable("mean_fahrenheit_temp"))
Try(sqlContext.dropTempTable("mean_fahrenheit_by_key_temp"))

val topics =Set("kafka_main_topic");
val stream = KafkaUtils.createDirectStream[String, String, StringDecoder, StringDecoder](ssc, kafkaConf, topics)


val values = stream.window(Seconds(windowIntervalSeconds)).map{ case(x, y) => y.toString}

values.print()

values.foreachRDD{ rdd =>
    val valuesDf = sqlContext.read.json(rdd) 
    valuesDf.registerTempTable("mqtt_message_temp")
}

val schemaFahr = StructType(
    Seq(
        StructField(name = "mean_fahrenheit", dataType = DoubleType, nullable = false)
        )
    )

val schemaFahrByKey = StructType(
    Seq(
        StructField(name = "mean_fahrenheit_by_key", dataType = DoubleType, nullable = false)
        )
    )


val meanFahr = stream.map{ 
    case(x, y) => (
        JSON.parseFull(y)
        .get.asInstanceOf[Map[String,String]]
        .get("fahrenheit").get.toFloat
        ,1)}
    .reduceByWindow({
        (x: (Float, Int),y:(Float, Int)) => (x._1 + y._1, x._2 + y._2)}
        ,Seconds(windowIntervalSeconds)
        ,Seconds(batchIntervalSeconds))
    .map{ case(x, y) => Row(1.0 * x / y)}
    .foreachRDD{
        rdd =>
        sqlContext.createDataFrame(rdd, schemaFahr).registerTempTable("mean_fahrenheit_temp")
    }

val meanFahrByKey = stream.map{ 
    case(x, y) => (x,
        (JSON.parseFull(y)
        .get.asInstanceOf[Map[String,String]]
        .get("fahrenheit").get.toFloat
        ,1))}
    .reduceByKeyAndWindow({
        (x: (Float, Int),y:(Float, Int)) => (x._1 + y._1, x._2 + y._2)}
        ,Seconds(windowIntervalSeconds)
        ,Seconds(batchIntervalSeconds))
    .map{ case(x, y) => Row(1.0 * y._1 / y._2) }
    .foreachRDD{
        rdd =>
        sqlContext.createDataFrame(rdd, schemaFahrByKey).registerTempTable("mean_fahrenheit_by_key_temp")
    }

/** Start StreamingContext */
ssc.start()
/** Stops StreamingContext at an specific time interval */
ssc.awaitTerminationOrTimeout(windowIntervalSeconds * 1000)

if (true) {	
  StreamingContext.getActive.foreach { _.stop(stopSparkContext = false) }
}

Try(
    sqlContext.sql("""CREATE TABLE IF NOT EXISTS kafka_message (
                        celcius string,
                        cliente string,
                        fahrenheit string,
                        fecha string,
                        humedad string,
                        ind_cal_cel string,
                        ind_cal_far string,
                        microsegundos string,
                        timestamp string)""")
    )

Try(sqlContext.sql("INSERT INTO TABLE kafka_message SELECT * FROM mqtt_message_temp"))

%spark

import org.apache.spark.mllib.regression.LabeledPoint
import org.apache.spark.mllib.linalg.Vectors
import org.apache.spark.mllib.clustering.{KMeans, KMeansModel}

var dataset = sqlContext.sql("select humedad, fahrenheit from kafka_message")
dataset  = dataset.withColumn("humedad", dataset("humedad").cast(DoubleType))
dataset = dataset.withColumn("fahrenheit", dataset("fahrenheit").cast(DoubleType))

var test = sqlContext.sql("select humedad, fahrenheit, timestamp, fecha, row_number() over () as id from mqtt_message_temp")
test  = test.withColumn("humedad", test("humedad").cast(DoubleType))
test = test.withColumn("fahrenheit", test("fahrenheit").cast(DoubleType))


val parsedData = dataset.map(r => Vectors.dense(r.getDouble(0).toDouble, r.getDouble(1).toDouble)).cache()
val parsedTest = test.map(r => Vectors.dense(r.getDouble(0).toDouble, r.getDouble(1).toDouble)).cache()


// Cluster the data into two classes using KMeans
val numClusters = 6
val numIterations = 20
val clusters = KMeans.train(parsedData, numClusters, numIterations)

// Evaluate clustering by computing Within Set Sum of Squared Errors
val WSSSE = clusters.computeCost(parsedData)
println("Within Set Sum of Squared Errors = " + WSSSE)

// Save and load model
//clusters.save(sc, "/user/zeppelin/kmeansModel6clusters")
//val sameModel = KMeansModel.load(sc, "/user/zeppelin/kmeansModel6clusters")


var cnt = 0 
val result = clusters.predict(parsedTest).collect().map(i => {cnt+=1;  (cnt,i)} ) //.map(x=> (row_number(), x))
var resultDf = sc.parallelize(result).toDF("id","cluster")

test.show()
resultDf.show()

var resultPointsDf = resultDf.as("df1")
    .join(test.as("df2"), resultDf("id") === test("id"), "inner")
    .select("df2.timestamp", "df2.fecha", "df2.humedad","df2.fahrenheit", "df1.cluster")

z.show(resultPointsDf)
